  false,\n\t\"url\": null,\n\t\"notes\": \"The Housing Affordability Data System (HADS)
  is a set of files derived from the 1985 and later national American Housing Survey
  (AHS) and the 2002 and later Metro AHS. This system categorizes housing units by
  affordability and households by income, with respect to the Adjusted Median Income,
  Fair Market Rent (FMR), and poverty income. It also includes housing cost burden
  for owner and renter households. These files have been the basis for the worst case
  needs tables since 2001. The data files are available for public use, since they
  were derived from AHS public use files and the published income limits and FMRs.
  These dataset give the community of housing analysts the opportunity to use a consistent
  set of affordability measures.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
